INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24001, "アヤネ", 401, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 0.0, 102301, 0.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24002, "アヤネ", 402, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 0.0, 102301, 2.21, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24003, "アヤネ", 403, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 0.0, 102301, 0.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24004, "アサヒ", 701, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 0.0, 192201, 1.99, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24005, "アサヒ", 702, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 0.0, 192201, 2.21, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24006, "アサヒ", 703, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 0.0, 192201, 3.33, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24007, "部員３", 801, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 0.0, 192301, 0.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24008, "部員３", 802, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 0.0, 192301, 2.68, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24009, "部員３", 803, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 0.0, 192301, 0.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24010, "", 501, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "やった！", 1, 0.0, 192501, 0.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24011, "", 502, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "勝ったよ！", 1, 0.0, 192501, 0.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24012, "", 503, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "いい調子！", 1, 0.0, 192501, 0.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24013, "ミサト", 111, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 0.0, 113501, 5.33, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24014, "ミサト", 112, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 0.0, 113501, 6.85, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24015, "ミサト", 113, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 0.0, 113501, 3.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24016, "ダイチ", 611, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 0.0, 192401, 6.11, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24017, "ダイチ", 612, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 0.0, 192401, 6.75, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24018, "ダイチ", 613, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 0.0, 192401, 0.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24019, "ハツネ", 211, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 0.0, 113401, 4.52, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24020, "ハツネ", 212, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 0.0, 113401, 3.89, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24021, "ハツネ", 213, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 0.0, 113401, 13.49, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24022, "カヤ", 311, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 0.0, 106501, 3.17, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24023, "カヤ", 312, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 0.0, 106501, 4.42, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24024, "カヤ", 313, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 0.0, 106501, 2.89, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (3, 24025, "アヤネ", 421, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 0.0, 102301, 3.71, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24026, "アサヒ", 721, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 0.0, 192201, 5.1, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (3, 24027, "部員３", 821, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 0.0, 192301, 4.34, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24028, "", 521, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 0.0, "いい勝負だったよ\nまたやろうね", 1, 0.0, 192501, 0.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24029, "ミサト", 101, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, 0.0, 113501, 5.62, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24030, "ミサト", 102, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, 0.0, 113501, 9.58, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24031, "ミサト", 103, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 0.0, 113501, 0.0, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1, 24032, "ミサト", 104, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, 0.0, 113501, 9.13, 10046);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2, 24033, "ミサト", 105, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, 0.0, 113501, 8.27, 10046);
